import React from 'react';
import './eligibilityToDonate.css';
function FeedCard(props) {

    return (
      <div className="feed-card">
        <img src={props.image} alt="Feed Image" />
        <div className="feed-content">
          <h3>{props.title}</h3>
          <p>{props.description}</p>
        </div>
      </div>
    );
  }
  
  function FeedsPage() {
    const feeds = [
      { id: 1, image: 'https://via.placeholder.com/150', title: 'Feed 1', description: 'This is the first feed.' },
      { id: 2, image: 'https://via.placeholder.com/150', title: 'Feed 2', description: 'This is the second feed.' },
      { id: 3, image: 'https://via.placeholder.com/150', title: 'Feed 3', description: 'This is the third feed.' },
    ];
  
    return (
      <div className="feeds-container">
        {feeds.map(feed => (
          <FeedCard
            key={feed.id}
            image={feed.image}
            title={feed.title}
            description={feed.description}
          />
        ))}
      </div>
    );
  }

export default EligibilityToDonate;
